import React, {Component, useEffect, useState} from 'react';
import './ComicDisplay.css';
import {connect} from 'react-redux';

class ComicDisplay extends Component {
    render() {
        const {number} = this.props.number;

        return (
            <div>
                <h1>Number should pop up here {number}</h1>
                <div>{number}</div>
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {
        number: state.number,
        url: state.url
    };
};
const mapDispatchToProps = dispatch => {
    return {
        handlePreviousClick: () => dispatch({type: 'PREVIOUS'}),
        handleNextClick: () => dispatch({type: 'NEXT'}),
        handleRandomClick: () => dispatch({type: 'RANDOM'})
    }
};

export default connect(mapStateToProps, null)(ComicDisplay);
